.gear-card-header {
    display: flex;
    align-items: center;
    gap: 10px;
    margin-bottom: 12px;
    padding-bottom: 10px;
    border-bottom: 1px solid var(--border-subtle);
}

.gear-card-icon {
    font-size: 1.2rem;
}

.gear-card-title {
    flex: 1;
    font-family: 'Rye', cursive;
    font-size: 1rem;
    color: var(--text-cream);
}

.gear-card-stats {
    display: grid;
    grid-template-columns: repeat(2, 1fr);
    gap: 8px;
    margin-bottom: 12px;
}

.gear-stat {
    display: flex;
    justify-content: space-between;
    align-items: center;
    padding: 6px 10px;
    background: var(--bg-dark);
    border-radius: 4px;
}

.gear-stat-label {
    font-size: 0.7rem;
    color: var(--text-muted);
    text-transform: uppercase;
    letter-spacing: 0.5px;
}

.gear-stat-value {
    font-size: 0.9rem;
    color: var(--text-cream);
    font-weight: 600;
}

.gear-stat-value.stat-good {
    color: #5cb85c;
}

.gear-card-footer {
    display: flex;
    justify-content: space-between;
    align-items: center;
    padding-top: 10px;
    border-top: 1px solid var(--border-subtle);
}

.gear-cost {
    font-family: 'Rye', cursive;
    color: var(--gold);
    font-size: 0.95rem;
}

.gear-availability {
    font-size: 0.8rem;
    color: var(--text-muted);
    font-style: italic;
}

/* Responsive adjustments for cards */
@media (max-width: 600px) {
    .horse-card {
        flex-direction: column;
        align-items: center;
        text-align: center;
    }

    .horse-card-image {
        width: 140px;
        height: 140px;
    }

    .horse-card-badges {
        justify-content: center;
    }

    .stat-row {
        flex-wrap: wrap;
    }

    .stat-row .stat-label {
        width: 100%;
        text-align: center;
        margin-bottom: 4px;
    }

    .stat-row .stat-value {
        width: 100%;
        text-align: center;
        margin-top: 4px;
    }

    .gear-card {
        max-width: 100%;
    }

    .gear-card-stats {
        grid-template-columns: 1fr;
    }
}

